import React from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import TimeCounter from "./TimeCounter";

function Objetivos({ auth }) {
  return (
    <div className="row stylep" style={{ justifyContent: "center" }}>
      <div className="col-lg-12 col-md-12 text-center">
        <h1 className="py-4">¿Qué obtendré en Starkclass.com?</h1>
      </div>
      <div className="objetivo-list col-lg-5 col-md-6 text-left">
        <p>• Clases GRABADAS y ONLINE.</p>
        <p>• REPASO Parcial y Final para la Pre. </p>
        <p>• REPASO de Admisión General ULima.</p>
        <p>• RESÚMENES en Psicología e História.</p>
        <p>• Sílabos y ejercicios del MISMO centro UL.</p>
      </div>
      <div className="objetivo-list col-lg-4 col-md-6 text-left">
        <p>• TRACKING Académico.</p>
        <p>• ASESORÍA Virtual </p>
        <p>• Material DESCARGABLE.</p>
        <p>• Fácil ACCESO desde cualquier dispositivo.</p>
        <p>• Ejercicios ACTUALIZADOS.</p>
      </div>

      <div className="col-md-12 m-auto pt-4" align="center">
        <br /> <br />
        <h3 style={{ fontSize: "3rem" }} className="m-4 mx-auto text-center">
          CUPÓN DE DESCUENTO VÁLIDO HASTA...
          <br />
          <br />
          <TimeCounter hr={16} />
        </h3>{" "}
        <br />
        <br />
        {auth.user.isPremium ? (
          <Link
            className="btn-orange btn shadow-lg my-4 mx-auto"
            aria-pressed="true"
            to={{
              pathname: "/rep",
            }}
          >
            Ver clases
          </Link>
        ) : (
          <Link
            className="btn-orange btn shadow-lg my-4 mx-auto"
            aria-pressed="true"
            to={{
              pathname: "/pago",
            }}
          >
            Comprar
          </Link>
        )}
        <br />
      </div>
    </div>
  );
}
const mapStateToProps = (state) => ({
  auth: state.auth,
});

const mapDispatchToProps = (dispatch, props) => ({});

export default connect(mapStateToProps, mapDispatchToProps)(Objetivos);
